window.bookSummaryJSON = "<p><b>Headmaster. Exile. Gladiator.</b></p> <p>Backed into a corner, Artorian must play fast and loose with the laws of the land. To gather what he needs to progress, he will need to sacrifice what he’s gained in order to get this far.</p> <p>With his new school and friends facing their most deadly challenges yet, Artorian finds an opportunity to keep them safe. The cost of it may be access to the new home he’s built, but that was never intended to be for him.</p> <p>When he can ensure their safety, Artorian will begin pursuit of his grandchildren once more. If he finds them, will they want to be saved...or will they have found a taste for the darker powers they have accrued? It’s time to make the hard choices.</p> <p>Death or graduation.</p>"; 
